import { useState, useEffect } from 'react'
import "./Cars.css"
import CarInstance from './CarInstance'
import { fetch_data } from "../../utils/api";

interface Car {
    car_id: number;
    mark: string;
    category: string;
    price: number;
    transmission: string;
    status: string;
    image_path: string;
  }

export const Cars = () => {
    const [cars, setCars] = useState<Car[]>([]);

    useEffect(() => {
        const getCars = async () => {
          try {
            const data = await fetch_data('/car/getAll', 'GET');
            console.log(data)
            setCars(data);
          } catch (error: any) {
            console.error(error.message);
          }
        };
        getCars();
      }, []);

    return (
        <div className="car-container my-4">
            <div className="row row-cols-3 gy-4 car-list" id="car-list">
                {cars.map((car, index) => (
                    <CarInstance
                        key={car.car_id}
                        strMark={car.mark}
                        strPrice={car.price.toString()}
                        strImagePath={car.image_path}
                    />
                ))}
            </div>
        </div>
    );
}
